import React from "react";
import "./inicio.css"
import { Code } from "phosphor-react";
import yoo from "../img/yoo.png";
import {GithubLogo} from "phosphor-react";
import {LinkedinLogo} from "phosphor-react";
import {FileArrowDown} from "phosphor-react";
import {WhatsappLogo} from "phosphor-react";

export default function Inicio () {
    return <div id="ini" className="sobremi">
        
        <main className="col">
        <article className="infooimg">
            <img className="infooimg" src={yoo} alt="Matias Sosa" />     
        </article>
            <article className="infoo">
                <h1>Matias Sosa <br />
                    Programador Full Stack</h1>
                    <Code size={40} />
            </article>
                
        </main>
        <div className="links">
                    <h2>Tecnolog√≠as</h2>
                    <GithubLogo size={40} alt="github"/>
                    <LinkedinLogo size={40} alt="linkedin"/>
                    <FileArrowDown size={40} alt="cv"/>
                    <WhatsappLogo size={40} />
                </div>
    </div>

}
